--------------------------------------------------------
--  DDL for Package TIT
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE PACKAGE "NET"."TIT" AS 

  cursor cur_tit is select * from titles where id = 'tm45720';
  inc_rate number := 0.5;
  procedure increase_rate;
  function get_avg_rate(p_dept_rate number) return number;
  im_rate number := 116;

  procedure insert_title_copy;
  procedure delete_title_copy;
  


END TIT;

/
--------------------------------------------------------
--  DDL for Package Body TIT
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE PACKAGE BODY "NET"."TIT" AS
    
      r_tit titles%rowtype;
    --UPDATE IMDB_SCORE 
  procedure increase_rate AS
  BEGIN
    for i in cur_tit loop
        update titles set imdb_score = imdb_score + inc_rate;
    end loop;
    NULL;
  END increase_rate;


    --AVERAGE IMDB_RATE by Runtime
  function get_avg_rate(p_dept_rate number) return number AS
  v_avg_rate number := 0;
  BEGIN
    select avg(imdb_score) into v_avg_rate from titles where imdb_score > 9;
    
    RETURN v_avg_rate;
  END get_avg_rate;
  
  
  -- insert values into title copy with records
  procedure insert_title_copy as
  begin
   select * into r_tit from titles where id = 'tm348735';
  end insert_title_copy;
  
  
  procedure delete_title_copy as
  begin
    delete from titles_copy where id = 'tm45720';
  end delete_title_copy;
  
  
END TIT;

/
